import React, { useEffect } from "react";

import { Switch, Route, useLocation, withRouter } from "react-router-dom";

import { TransitionGroup, CSSTransition } from "react-transition-group";

import Index from "./pages/Index";
import Home from "./pages/Home";
import Search from "./pages/Search";
import Product from "./pages/Product";
import Cotiplas from "./pages/Cotiplas";
import Brinquedos from "./pages/Brinquedos";
import FaleConosco from "./pages/FaleConosco";
import MaterialDeApoio from "./pages/MaterialDeApoio";
import Catalog from './pages/MaterialDeApoio/Catalog';
import Files from './pages/MaterialDeApoio/Files';
import AreaRestrita from './pages/AreaRestrita/';
import CadastreSe from './pages/AreaRestrita/CadastreSe';
import LostPassword from './pages/AreaRestrita/LostPassword';
import Atividades from './pages/Atividades';
import Museu from './pages/Museu';
import Category from './pages/Category';
import OurStores from './pages/OurStores';
import Reclamacoes from './pages/Reclamacoes';
import AssistenciaTecnica from './pages/AssistenciaTecnica/';
import Duvidas from "./pages/Duvidas";


const Routes = () => {
  const location = useLocation();

  return (
        <div>
            <Switch location={location}>
            <Route exact path="/area-restrita" component={AreaRestrita} />
            <Route path="/area-restrita/lost-password" component={LostPassword} />
            <Route path="/area-restrita/cadastre-se" component={CadastreSe} />

            <PrivateRoute exact path='/material-de-apoio' component={MaterialDeApoio} />
            <PrivateRoute path='/material-de-apoio/catalogo' component={Catalog} />
            <PrivateRoute path='/material-de-apoio/arquivos' component={Files} />

            <Route path="/reclamacoes" component={Reclamacoes} />
            <Route path="/duvidas" component={Duvidas} />
            <Route path="/assistencia-tecnica" component={AssistenciaTecnica} />
            <Route path="/home" component={Home} />
            <Route exact path="/" component={Index} />
            <Route path="/:name/p" component={Product} />
            <Route path="/cotiplas" component={Cotiplas} />
            <Route path="/museu-cotiplas" component={Museu} />
            <Route exact path="/brinquedos" component={Brinquedos} />
            <Route exact path="/categoria/:category" component={Category} />
            <Route exact path="/categoria/:category/:subcategory" component={Category} />
            <Route path="/onde-estamos" component={OurStores} />
            <Route path="/contato" component={FaleConosco} />
            <Route path="/atividades" component={Atividades} />
            <Route exact path="/:name" component={Search} />

            </Switch>
        </div>
  );
}

export default Routes;
